// 节点配置，目前仅支持 normal
var NodeConfig = {
    normal: {
        stroke: '#A2B1C3',
        fill: '#FFFFFF',
    },
};
var LabelConfig = {
    normal: {
        fill: '#000',
    },
};
export var DarkTheme = {
    NodeConfig: NodeConfig,
    LabelConfig: LabelConfig,
};
